import React, {Component} from "react";
import DepartmentGrid from "./DepartmentsGrid";
import DepartmentList from "./DepartmentsList";
import { Button } from 'react-bootstrap';

class Departments extends Component{
    render (){
        return(
            <>
                <h1>Departments</h1>

                <Button variant="primary" className="btn-sm ml-2">
                    List View
                </Button>
                <Button variant="info" className="btn-sm ml-2">
                    Grid View
                </Button>
                <DepartmentGrid />
                <DepartmentList />
            </>
        )
    }
}

export default Departments;
